volatile int *pixel_ctrl_ptr;
volatile int pixel_buffer_start;

int canvas[HEIGHT][WIDTH];
int setupCanvas[HEIGHT][WIDTH];         // Your binary canvas
short int coloredCanvas[HEIGHT][WIDTH]; // Canvas to hold color values
short int sphereCanvas[HEIGHT][WIDTH];

int sphereX = 290; // Initial X position of the sphere
int sphereY = 205; // Initial Y position of the sphere
int radius = 10;   // Radius of the sphere
int velocityX = 4; // X velocity
int velocityY = 2; // Y velocity
int sensivity = 100; // Sensivity of the accelerometer
bool accelerometer_on = false;

short int BACKGROUND_COLOR;
short int WALL_COLOR;
short int SPHERE_COLOR;

int main(void)
{
    /////////////////////// Configure accelerometer //////////////////////////////
    if (accelerometer_on) {
        uint8_t devid;
        int16_t mg_per_lsb = 10;
        int16_t XYZ[3];

        // Configure Pin Muxing
        Pinmux_Config();

        // Initialize I2C0 Controller
        I2C0_Init();

        // 0xE5 is read from DEVID(0x00) if I2C is functioning correctly
        ADXL345_REG_READ(0x00, & devid);

        if (devid == 0xE5) {
            // Initialize accelerometer chip
            ADXL345_Init();

            // while (1) {
            //     if (ADXL345_IsDataReady()) {
            //         ADXL345_XYZ_Read(XYZ);
            //         printf("X=%d mg, Y=%d mg, Z=%d mg\n", XYZ[0] * mg_per_lsb,
            //         XYZ[1] * mg_per_lsb, XYZ[2] * mg_per_lsb);
            //         display(XYZ);
            //     }
            // }

        } else {
            printf("Incorrect device ID\n");
        }
    }

    // FIR filter coefficients
    float filterCoefficients[N] = {-0.0553, 0.0465, 0.1513, 0.2611, 0.3080, 0.2611, 0.1513, 0.0465, -0.0553};

    // Circular buffer to hold the recent N samples
    float circularBuffer_x[N] = {0};
    float circularBuffer_y[N] = {0};

    // Start index for the circular buffer
    int startIndex_x = 0;
    int startIndex_y = 0;


    ///////////////// Initializing front/back pixel buffer ////////////////////////

    pixel_ctrl_ptr = (int *)0xFF203020; // pointing at the front buffer
    *(pixel_ctrl_ptr + 1) = 0xC8000000; // first store the address in the back buffer
    wait_for_vsync();
    // Initialize the base address to the first pixel in the front buffer(On-chip)
    pixel_buffer_start = *pixel_ctrl_ptr;

    // Initializing 320x240 pixels in the front buffer
    load_screen(); // pixel_buffer_start points to the pixel buffer

    *(pixel_ctrl_ptr + 1) = 0xC0000000;         // set back pixel buffer to start of SDRAM memory
    pixel_buffer_start = *(pixel_ctrl_ptr + 1); // we draw on the back buffer

    // Initializing 320x240 pixels in the back buffer(SDRAM)
    load_screen();
    wait_for_vsync();

    // Setup part, change this part
    // Set colors for specific regions (example regions given)
    setColor(60, 100, 100, 140, BLUE);   // Wall
    setColor(140, 100, 180, 140, RED);   // Wall
    setColor(220, 100, 260, 140, GREEN); // Sphere
    draw_coloredCanvas();
    while (true)
    {
        if (isSetupFinished())
        {
            break; // Exit the loop if the last button is pressed
        }
    }

    //////////////////// Setup is finished, start the game :) ////////////////////
    draw_maze(PINK, BLACK);

    draw_filled_circle_in_array(sphereX, sphereY, radius);

    combine_and_draw(WHITE, BLACK, BLUE);

    while (1)
    {
        // Read the accelerometer data
        if (accelerometer_on) {
            int16_t XYZ[3];
            ADXL345_XYZ_Read(XYZ);
            XYZ[0] = XYZ[0] / 2.8;
            XYZ[1] = XYZ[1] / 2.8;
            XYZ[2] = XYZ[2] / 2.8;

            velocityX = processSample(filterCoefficients, circularBuffer_x, &startIndex_x, XYZ[0]) / sensivity;
            velocityY = processSample(filterCoefficients, circularBuffer_y, &startIndex_y, XYZ[1]) / sensivity;
        }

        move_sphere();
        combine_and_draw(GREEN, RED, BLUE);
    }

    return 0;
}

void plot_pixel(int x, int y, short int line_color)
{
    *(short int *)(pixel_buffer_start + (y << 10) + (x << 1)) = line_color;
}

void draw_maze(short int background_color, short int wall_color)
{
    for (int y = 0; y < 240; y++)
    {
        for (int x = 0; x < 320; x++)
        {
            short int color;
            if (canvas[y][x] == 0)
            { // background
                color = background_color;
            }
            else
            { // wall
                color = wall_color;
            }
            plot_pixel(x, y, color);
        }
    }
}

// Initialize sphere_canvas array to zero
void init_sphere_canvas()
{
    for (int y = 0; y < HEIGHT; y++)
    {
        for (int x = 0; x < WIDTH; x++)
        {
            sphereCanvas[y][x] = 0;
        }
    }
}

// Fill the sphereCanvas with the filled circle
void draw_filled_circle_in_array(int center_x, int center_y, int radius)
{
    init_sphere_canvas();
    for (int y = -radius; y <= radius; y++)
    {
        for (int x = -radius; x <= radius; x++)
        {
            if (x * x + y * y <= radius * radius)
            {
                int canvasX = center_x + x;
                int canvasY = center_y + y;
                if (canvasX >= 0 && canvasX < WIDTH && canvasY >= 0 && canvasY < HEIGHT)
                {
                    sphereCanvas[canvasY][canvasX] = 1; // Assuming 1 represents sphere
                }
            }
        }
    }
}

void combine_and_draw(short int background_color, short int wall_color, short int circle_color)
{
    for (int y = 0; y < HEIGHT; y++)
    {
        for (int x = 0; x < WIDTH; x++)
        {
            short int color;
            if (sphereCanvas[y][x] == 1)
            {
                // If the pixel is part of the circle
                color = circle_color;
            }
            else if (canvas[y][x] == 1)
            {
                // If the pixel is part of the wall
                color = wall_color;
            }
            else
            {
                // Background
                color = background_color;
            }
            plot_pixel(x, y, color);
        }
    }
}

void move_sphere()
{
    // Predict the next position
    int nextX = sphereX + velocityX;
    int nextY = sphereY + velocityY;

    // Check for horizontal collision
    for (int y = -radius; y <= radius; y++)
    {
        if (nextY + y >= 0 && nextY + y < HEIGHT)
        {
            if ((nextX - radius >= 0 && canvas[nextY][nextX - radius] == 1 && velocityX < 0) ||
                (nextX + radius < WIDTH && canvas[nextY][nextX + radius] == 1 && velocityX > 0))
            {
                velocityX = -velocityX;
                break; // Break after detecting any collision
            }
        }
    }

    // Check for vertical collision
    for (int x = -radius; x <= radius; x++)
    {
        if (nextX + x >= 0 && nextX + x < WIDTH)
        {
            if ((nextY - radius >= 0 && canvas[nextY - radius][nextX] == 1 && velocityY < 0) ||
                (nextY + radius < HEIGHT && canvas[nextY + radius][nextX] == 1 && velocityY > 0))
            {
                velocityY = -velocityY;
                break; // Break after detecting any collision
            }
        }
    }

    // Update sphere position based on updated velocity
    sphereX += velocityX;
    sphereY += velocityY;

    // Keep the sphere within bounds
    sphereX = max(0, min(sphereX, WIDTH - 1));
    sphereY = max(0, min(sphereY, HEIGHT - 1));

    // printf("vel x : %d\n", velocityX);
    // printf("vel y : %d\n", velocityY);
    // Draw sphere again
    draw_filled_circle_in_array(sphereX, sphereY, radius);
}




void load_screen()
{
    // Redraw whole 320x240 VGA screen to WHITE
    for (int x = 0; x < 320; x++)
    {
        for (int y = 0; y < 240; y++)
        {
            plot_pixel(x, y, WHITE); // Plotting black pixel all over the VGA display
        }
    }
}

void wait_for_vsync()
{
    volatile int *pixel_ctrl_ptr = (int *)0xFF203020; // pixel controller of front buffer address
    register int status;                              // the status register

    *pixel_ctrl_ptr = 1; // start the synchronization procress by writing
                         //  the value 1 into the front Buffer register in the pixel buffer controller

    status = *(pixel_ctrl_ptr + 3); // Wait for the S bit to become 0, that means VGA sweep is done
    // 3*(4 bits) = 12 bits = 0xFF20302C

    // Polling to get status bit
    while ((status & 0x01) != 0)
    { // wait until bit S of the Status register becomes equal to 0
        status = *(pixel_ctrl_ptr + 3);
    }
}

void clear_screen(bool clear_text_box)
{
    if (!clear_text_box)
    { // clear the whole screen
        for (int x = 0; x < 320; x++)
        {
            for (int y = 0; y < 240; y++)
            {
                plot_pixel(x, y, WHITE); // Plotting black pixel all over the VGA display
            }
        }
    }
    else
    {
        for (int x = 31; x < 300; x++)
        {
            for (int y = 41; y < 230; y++)
            {
                plot_pixel(x, y, WHITE); // Plotting black pixel all over the VGA display
            }
        }
    }
}

// Function to set color for a specific region
void setColor(int x_start, int y_start, int x_end, int y_end, short int color)
{
    for (int y = y_start; y <= y_end; y++)
    {
        for (int x = x_start; x <= x_end; x++)
        {
            if (setupCanvas[y][x] == 1)
            { // Check if the pixel is part of the item
                coloredCanvas[y][x] = color;
            }
        }
    }
}

// Draw the colored canvas
void draw_coloredCanvas()
{
    for (int y = 0; y < 240; y++)
    {
        for (int x = 0; x < 320; x++)
        {
            short int color;
            if (coloredCanvas[y][x] == 0)
            { // background
                color = WHITE;
            }
            else
            { // wall
                color = coloredCanvas[y][x];
            }
            plot_pixel(x, y, color);
        }
    }
}

// Function to check if the last button is pressed
bool isSetupFinished()
{
    // Create a pointer to the button memory location
    volatile uint32_t *buttons = (volatile uint32_t *)BUTTONS_MEM_LOC;

    // Read the state of the buttons
    uint32_t state = *buttons;

    // Adjust here
    return (state & 0x01) != 0;
}

// Initialize canvas from a csv file
void loadCanvas(const char *filename)
{
    FILE *file = fopen(filename, "r");
    if (file == NULL)
    {
        perror("Error opening file");
        return;
    }

    for (int i = 0; i < 240; i++)
    {
        for (int j = 0; j < 320; j++)
        {
            if (fscanf(file, "%d,", &canvas[i][j]) != 1)
            {
                perror("Error reading file");
                fclose(file);
                return;
            }
        }
    }

    fclose(file);
}

////////////// Accelerometer Functions Start //////////////
void Pinmux_Config() {
  * SYSMGR_I2C0USEFPGA = 0;
  * SYSMGR_GENERALIO7 = 1;
  * SYSMGR_GENERALIO8 = 1;
}

void I2C0_Init() {

    // Abort any ongoing transmits and disable I2C0.
    * I2C0_ENABLE = 2;

    // Wait until I2C0 is disabled
    while ((( * I2C0_ENABLE_STATUS) & 0x1) == 1) {}
    // Configure the config reg with the desired setting (act as
    // a master, use 7bit addressing, fast mode (400kb/s)).
    * I2C0_CON = 0x65;

    // Set target address (disable special commands, use 7bit addressing)
    * I2C0_TAR = 0x53;

    // Set SCL high/low counts (Assuming default 100MHZ clock input to
    //I2C0 Controller).
    // The minimum SCL high period is 0.6us, and the minimum SCL low
    //period is 1.3 us,
    // However, the combined period must be 2.5us or greater, so add 0.3us
    //to each.
    * I2C0_FS_SCL_HCNT = 60 + 30; // 0.6us + 0.3us
    * I2C0_FS_SCL_LCNT = 130 + 30; // 1.3us + 0.3us

    // Enable the controller
    * I2C0_ENABLE = 1;

    // Wait until controller is powered on
    while ((( * I2C0_ENABLE_STATUS) & 0x1) == 0) {}
}


// Read value from internal register at address
void ADXL345_REG_READ(uint8_t address, uint8_t * value) {

    // Send reg address (+0x400 to send START signal)
    * I2C0_DATA_CMD = address + 0x400;
    // Send read signal
    * I2C0_DATA_CMD = 0x100;
    // Read the response (first wait until RX buffer contains data)
    while ( * I2C0_RXFLR == 0) {}
    * value = * I2C0_DATA_CMD;
}


// Write value to internal register at address
static void ADXL345_REG_WRITE(uint8_t address, uint8_t value) {

	*(I2C0_DATA_CMD) = address + 0x400;
	*(I2C0_DATA_CMD) = value;
}


void ADXL345_Init() {

	// +- 16g range, full resolution
	ADXL345_REG_WRITE(ADXL345_REG_DATA_FORMAT, XL345_RANGE_2G | XL345_FULL_RESOLUTION);
	// Output Data Rate: 100Hz
	ADXL345_REG_WRITE(ADXL345_REG_BW_RATE, XL345_RATE_100);
	// stop measure
	ADXL345_REG_WRITE(ADXL345_REG_POWER_CTL, XL345_STANDBY);
	// start measure
	ADXL345_REG_WRITE(ADXL345_REG_POWER_CTL, XL345_MEASURE);
	
}


// Read multiple consecutive internal registers
void ADXL345_REG_MULTI_READ(uint8_t address, uint8_t values[], uint8_t len) {

	int i = 0;
	int nth_byte = 0;
	*(I2C0_DATA_CMD) = address + 0x400;

	//send read signal multiple times to prevent overwritten data at 
	//inconsistent times

	for (i = 0; i < len; i++)
		*
		(I2C0_DATA_CMD) = 0x100;

	while (len) {
		if ( * (I2C0_RXFLR) > 0) {
		values[nth_byte] = * (I2C0_DATA_CMD) & 0xFF;
		nth_byte++;
		len--;
		}
	}
}


// Read acceleration data of all three axes
void ADXL345_XYZ_Read(int16_t szData16[3]) {

	uint8_t szData8[6];
	ADXL345_REG_MULTI_READ(0x32, (uint8_t * ) & szData8, sizeof(szData8));

	szData16[0] = (szData8[1] << 8) | szData8[0];
	szData16[1] = (szData8[3] << 8) | szData8[2];
	szData16[2] = (szData8[5] << 8) | szData8[4];
}


// Return true if there is new data
bool ADXL345_IsDataReady() {
	bool bReady = false;
	uint8_t data8;

	ADXL345_REG_READ(ADXL345_REG_INT_SOURCE, & data8);
	if (data8 & XL345_DATAREADY)
		bReady = true;

	return bReady;
}

struct SevenSegForm {
	uint8_t seg_onces;
	uint8_t seg_tens;
	bool is_negative;
};

int8_t to_7seg(int8_t number) {
	switch (number) {
	case 0:
		return 0x3F;
	case 1:
		return 0x06;
	case 2:
		return 0x5B;
	case 3:
		return 0x4F;
	case 4:
		return 0x66;
	case 5:
		return 0x6D;
	case 6:
		return 0x7D;
	case 7:
		return 0x07;
	case 8:
		return 0x7F;
	case 9:
		return 0x6F;
	default:
		return 0x00;
	}
}

struct SevenSegForm to_SevenSegForm(int16_t number) {
	struct SevenSegForm form;
	form.is_negative = false;
	if (number < 0) {
		form.is_negative = true;
		number = -number;
	}
	form.seg_onces = to_7seg(number % 10);
	form.seg_tens = to_7seg((number / 10) % 10);
	return form;
}


void display(int16_t XYZ[3]) {
	struct SevenSegForm form[3];
	form[0] = to_SevenSegForm(XYZ[0] / 2.6);
	form[1] = to_SevenSegForm(XYZ[1] / 2.6);
	form[2] = to_SevenSegForm(XYZ[2] / 2.6);
	* HEX_0 = form[2].seg_onces;
	* (HEX_0) += form[2].seg_tens << 8;
	* (HEX_0) += form[1].seg_onces << 16;
	* (HEX_0) += form[1].seg_tens << 24;
	* (HEX_0 + 4) = form[0].seg_onces;
	* (HEX_0 + 4) += form[0].seg_tens << 8;
	* (LEDR_BASE) = 0;
	for (int i = 0; i < 3; i++) {
		if(form[2 - i].is_negative) {
			* (LEDR_BASE) += 0x1 << i;
		}
	}
}

float processSample(float *coefficients, float *buffer, int *startIndex, float newSample) {
    float output = 0;
    int bufIndex;

    // Update the circular buffer with the new sample
    buffer[*startIndex] = newSample;

    // Calculate the convolution of the buffer and the filter coefficients
    bufIndex = *startIndex;
    for (int i = 0; i < N; i++) {
        output += buffer[bufIndex] * coefficients[i];
        bufIndex = (bufIndex != 0) ? (bufIndex - 1) : (N - 1);
    }

    // Update the start index for the circular buffer
    *startIndex = (*startIndex + 1) % N;

    return output;
}


